import { useSelector } from 'react-redux';
import FileBase from 'react-file-base64'
import Postp from './Postp/Postp';

const Postsp = () => {
  const postsp = useSelector((state) => state.postsp);
  console.log(postsp);
  
  return (
    <div>
        <h1>Posts Pegawai</h1>
        <Postp />
        <Postp />
        <Postp />

    </div>
  )
}

export default Postsp
